module.exports = "<div class=\"mt10 FEF__title sub\">\n    Transmettez-nous vos justificatifs pour l’ouverture de votre compte\n</div>\n<hr/>\n\n<div class=\"clearfix mt40\">\n    <div class=\"grid__col--8 no-padding\">\n        <div class=\"panel--alert\">\n            <i aria-hidden=\"true\"  class=\"icon icon-circle-info\"></i>\n            <p>\n                La qualité (ou l’exactitude) des pièces justificatives fournies conditionne la rapidité de traitement de votre demande. Vous pouvez scanner ou photographier avec votre mobile/tablette les documents papiers ou télécharger vos pièces au format électronique.\n                Formats acceptés : jpg, .jpeg, .png, .pdf, gif, .bmp.  Poids* maximum par document : 2 Mb (*paramétrable depuis votre mobile/tablette).\n            </p>\n        </div>\n        <div>\n            <div (click)=\"identityUploaded = true\" class=\"upload-checkbox\">\n                <div class=\"upload-checkbox__title\">Cliquez ici pour sélectionner votre</div>\n                <div class=\"upload-checkbox__subtitle\">1<sup>er</sup> justificatif d’identité</div>\n                <i aria-hidden=\"true\"  class=\"icon\" [ngClass]=\"{'icon-add':!identityUploaded,'icon-agree':identityUploaded}\"></i>\n            </div>\n            <div (click)=\"signatureUploaded = true\" class=\"upload-checkbox\">\n                 <div class=\"upload-checkbox__title\">Cliquez ici pour envoyer votre </div>\n                <div class=\"upload-checkbox__subtitle\">Signature manuscrite sur papier blanc en indiquant vos nom et prénom</div>\n                <i aria-hidden=\"true\"  class=\"icon\" [ngClass]=\"{'icon-add':!signatureUploaded,'icon-agree':signatureUploaded}\"></i>\n            </div>\n            <div (click)=\"taxImpositionUploaded = true\" class=\"upload-checkbox\">\n                <div class=\"upload-checkbox__title\">Cliquez ici pour envoyer votre</div>\n                <div class=\"upload-checkbox__subtitle\">Dernier avis d’imposition / de non-imposition ou Carte étudiant</div>\n                <i aria-hidden=\"true\"  class=\"icon\" [ngClass]=\"{'icon-add':!taxImpositionUploaded,'icon-agree':taxImpositionUploaded}\"></i>\n            </div>\n        </div>\n\n        <button pibButton type=\"button\" (click)=\"next()\" [attr.disabled]=\"identityUploaded && signatureUploaded && taxImpositionUploaded  ? null:true\" label=\"J'ai téléchargé toutes les pièces à ma disposition\" class=\"btn--primary f-right\">\n                    </button>\n\n        <a (click)=\"goBack()\" class=\"btn--back\">{{'hsbc-main.retour'|translate}}</a>\n\n        <hr class=\"bottom-hr\" />\n\n    </div>\n</div>"

